import {
  Assets,
  Blank,
  Buttons,
  Cards,
  Charts,
  Manage,
  Dashboard,
  DetailAsset,
  Forms,
  Home,
  Modals,
  Page404,
  RequestService,
  Tables,
  Permission
} from '../pages'

// use lazy for better code splitting, a.k.a. load faster
// const Dashboard = lazy(() => import('../pages/Dashboard'))
// const Forms = lazy(() => import('../pages/Forms'))
// const Cards = lazy(() => import('../pages/Cards'))
// const Charts = lazy(() => import('../pages/Charts'))
// const Buttons = lazy(() => import('../pages/Buttons'))
// const Modals = lazy(() => import('../pages/Modals'))
// const Tables = lazy(() => import('../pages/Tables'))
// const Page404 = lazy(() => import('../pages/404'))
// const Blank = lazy(() => import('../pages/Blank'))

/**
 * ⚠ These are internal routes!
 * They will be rendered inside the app, using the default `containers/Layout`.
 * If you want to add a route to, let's say, a landing page, you should add
 * it to the `App`'s router, exactly like `Login`, `CreateAccount` and other pages
 * are routed.
 *
 * If you're looking for the links rendered in the SidebarContent, go to
 * `routes/sidebar.js`
 */
const routes = [
  {
    path: '/home', // the url
    element: <Home/>, // view rendered
  },
  {
    path: '/dashboard', // the url
    element: <Dashboard/>, // view rendered
  },
  {
    path: '/assets', // the url
    element: <Assets/>, // view rendered
  },
  {
    path: '/assets/detail/:id', // the url
    element: <DetailAsset/>, // view rendered
  },
  {
    path: '/requestservice', // the url
    element: <RequestService/>, // view rendered
  },
  {
    path: '/manage', // the url
    element: <Manage/>, // view rendered
  },
  {
    path: '/manage/role/permission/:id', // the url
    element: <Permission/>, // view rendered
  },
  {
    path: '/404',
    element: <Page404/>,
  },

  // Sample Page
  {
    path: '/blank',
    element: <Blank/>,
  },

  // element Page
  {
    path: '/forms',
    element: <Forms/>,
  },
  {
    path: '/cards',
    element: <Cards/>,
  },
  {
    path: '/charts',
    element: <Charts/>,
  },
  {
    path: '/buttons',
    element: <Buttons/>,
  },
  {
    path: '/modals',
    element: <Modals/>,
  },
  {
    path: '/tables',
    element: <Tables/>,
  },
]

export default routes
